class Solution {
    public int numberOfBeautifulIntegers(int low, int high, int k) {
        int count = 0;
        for (int num = low; num <= high; num += k) { // Start from low and increment by k
            if (isBeautiful(num)) {
                count++;
            }
        }
        return count;
    }

    private boolean isBeautiful(int num) {
        int evenCount = 0, oddCount = 0;
        int originalNum = num;
        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) evenCount++;
            else oddCount++;
            num /= 10;
        }
        return evenCount == oddCount && originalNum % (evenCount + oddCount) == 0;
    }
}
